import org.junit.jupiter.api.Test;

import static org.junit.jupiter.api.Assertions.*;

class LargeIntegerTest {
    @Test
    void compareTo(){
        assertEquals( 0, new LargeInteger("").compareTo(new LargeInteger("")));
        assertEquals( 1, new LargeInteger(6).compareTo(new LargeInteger(4)));
        assertEquals( -1, new LargeInteger("1").compareTo(new LargeInteger("6")));
    }

    @Test
    void add() {
        assertEquals(new LargeInteger("6"), new LargeInteger("2").add(new LargeInteger("4")));
        assertEquals(new LargeInteger(100), new LargeInteger(50).add(new LargeInteger(50)));
        assertEquals(new LargeInteger("148686868686868000"), new LargeInteger("92121212121212000")
                .add(new LargeInteger("56565656565656000"))); // 17 чисел , 13мс
        assertEquals(new LargeInteger("6037"), new LargeInteger("5424").add(new LargeInteger("613")));
        assertEquals(new LargeInteger("132"), new LargeInteger("22").add(new LargeInteger("110")));
        assertEquals(new LargeInteger("1089"), new LargeInteger("968").add(new LargeInteger("121")));
        ////// Работы с числом, состоящим из 14402 цифр для проверки времени работы
        assertEquals(new LargeInteger   ("") ,
                new LargeInteger     ("")
                        .add(new LargeInteger("")));
    }

    @Test
    void sub() {
        assertEquals(new LargeInteger("6"), new LargeInteger("8").sub(new LargeInteger("2")));
        assertEquals(new LargeInteger("0"), new LargeInteger("1234").sub(new LargeInteger("1234")));
        assertEquals(new LargeInteger("0"), new LargeInteger("6").sub(new LargeInteger("6")));
        //assertEquals(new LargeInteger("-1"), new LargeInteger("5").sub(new LargeInteger("6")));
        assertEquals(new LargeInteger("613"), new LargeInteger("6037").sub(new LargeInteger("5424")));
        //assertEquals(new LargeInteger("-613"), new LargeInteger("5424").sub(new LargeInteger("6037")));
        assertEquals(new LargeInteger("5424000000000000000"), new LargeInteger("6037000000000000000")
                .sub(new LargeInteger("613000000000000000")));  //19 чисел , 14мс
        //assertEquals(new LargeInteger("-5424"), new LargeInteger("613").sub(new LargeInteger("6037")));
        assertEquals(new LargeInteger("1212"), new LargeInteger("10898").sub(new LargeInteger("9686")));
        ////// Работы с числом, состоящим из 14402 цифр для проверки времени работы
        assertEquals(new LargeInteger("")
                ,(new LargeInteger(""))
                .sub(new LargeInteger("")));
    }

    @Test
    void multi(){
        assertEquals(new LargeInteger("6"), new LargeInteger("2").multi(new LargeInteger("3")));
        assertEquals(new LargeInteger("144"), new LargeInteger("12").multi(new LargeInteger("12")));
        assertEquals(new LargeInteger("122"), new LargeInteger("2").multi(new LargeInteger("61")));
        assertEquals(new LargeInteger("132"), new LargeInteger("11").multi(new LargeInteger("12")));
        assertEquals(new LargeInteger("11988"), new LargeInteger("999").multi(new LargeInteger("12")));
        assertEquals(new LargeInteger("56240306652"), new LargeInteger("1231234").multi(new LargeInteger("45678"))); //14мс
    }

    @Test
    void div(){
        assertEquals(new LargeInteger("2"), new LargeInteger("6").div(new LargeInteger("3")));
        assertEquals(new LargeInteger("0"), new LargeInteger("3").div(new LargeInteger("6")));
        assertEquals(new LargeInteger("17"), new LargeInteger("17").div(new LargeInteger("1")));
        assertEquals(new LargeInteger("5"), new LargeInteger("17").div(new LargeInteger("3")));
        assertEquals(new LargeInteger("6"), new LargeInteger("96").div(new LargeInteger("15")));
        assertEquals(new LargeInteger("11"), new LargeInteger("155").div(new LargeInteger("13")));
        assertEquals(new LargeInteger("124123545"), new LargeInteger("67771455570").div(new LargeInteger("546")));
        assertEquals(new LargeInteger("100001"), new LargeInteger("123401234").div(new LargeInteger("1234")));
        assertEquals(new LargeInteger("27950"), new LargeInteger("34490300").div(new LargeInteger("1234")));
        assertEquals(new LargeInteger("314159265358979323846264338327950288419716939937510"),
                new LargeInteger("38785094135818519639450924855178371559922137693590845255390")
                        .div(new LargeInteger("123456789")));
    }

    @Test
    void mod(){
        assertEquals(new LargeInteger("2"), new LargeInteger("2").mod(new LargeInteger("6")));
        assertEquals(new LargeInteger("0"), new LargeInteger("6").mod(new LargeInteger("2")));
        assertEquals(new LargeInteger("1"), new LargeInteger("1").mod(new LargeInteger("17")));
        assertEquals(new LargeInteger("2"), new LargeInteger("17").mod(new LargeInteger("3")));
        assertEquals(new LargeInteger("6"), new LargeInteger("96").mod(new LargeInteger("15")));
        assertEquals(new LargeInteger("12"), new LargeInteger("155").mod(new LargeInteger("13")));
    }
}